import { createRouter, createWebHistory } from "vue-router";
import HomeView from "../views/HomeView.vue";
import admin from "../views/admin.vue";
import custom from "../views/custom.vue";
import blog from "../views/blog.vue";
// import custom_detail from "../components/custom/custom_detail.vue"
import error from "../components/not_found.vue";

const routes = [
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/admin",
    name: "admin",
    component: admin,
  },
  {
    path: "/custom",
    name: "custom",

    component: custom,
    // children:[
    //   {
    //     path:':id',
    //     name: "custom_detail",
    //     // component:() => import("../components/custom/custom_detail.vue"),
    //     component:custom_detail

    //   }
    // ]
  },
  {
    path: "/custom/:id",
    name: "custom_detail",
    component: () => import("../components/custom/custom_detail.vue"),
    children: [
      // this will render the UserDetails for these 3 URLs
      // - /users/24
      // - /users/24/profile
      // - /24
      { path: ':0', component: admin, alias: ['/:id', ''] },
    ],
  },

  {
    path: "/blog",
    name: "blog",
    component: blog,
  },
  {
    path: "/blog/:id",
    name: "blog_detail",
    component: () => import("../components/blog/blogDetail.vue"),
  },
  { path: "/:pathMatch(.*)*", component: error },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
